edu.concordia.dpis.MulticastListener#$@$#joinGroup()#$@$#new Thread(new Runnable(){

    () {
        super();
    }

    @Override()
    public void run() {
        System.out.println("multicast listener getting ready...");
        while (true) {
            if (!multicastSocket.isClosed()) {
                byte[] buf = new byte[1024];
                DatagramPacket pack = new DatagramPacket(buf, buf.length);
                try {
                    multicastSocket.receive(pack);
                    System.out.println("received a packet from multisocket in multicastlistener");
                    ReliableMessage request = (ReliableMessage)MessageTransformer.deserializeMessage(pack.getData());
                    Message replyMsg = onMessage(request);
                    if (replyMsg.isReply() && replyMsg.isReplyToThisMessage()) {
                        UDPClient.INSTANCE.send(replyMsg, 3000);
                    }
                } catch (IOException e) {
                    e.printStackTrace();
                } catch (TimeoutException e) {
                    e.printStackTrace();
                }
            }
        }
    }
}).start#$@$#METHOD

