edu.concordia.dpis.Replica#$@$#election(java.lang.String)#$@$#new Thread(new Runnable(){

    () {
        super();
    }

    @Override()
    public void run() {
        for (final Node node : nodes) {
            if (leaderName == null) {
                try {
                    if (Integer.parseInt(node.getAddress().getId()) > Integer.parseInt(address.getId())) {
                        System.out.println("sent election message to node deployed on " + node.getAddress().getHost() + " and on port " + node.getAddress().getPort());
                        MessageType mType = node.election(address.getId());
                        if (MessageType.COORDINATOR.equals(mType)) {
                            System.out.println("node deployed on " + node.getAddress().getHost() + " and on port " + node.getAddress().getPort() + " replied with a COORDINATOR message");
                            newLeader(node.getAddress().getId());
                        } else if (MessageType.OK.equals(mType)) {
                            System.out.println("node deployed on " + node.getAddress().getHost() + " and on port" + node.getAddress().getPort() + " replied with a OK message");
                            try {
                                System.out.println("will wait for some time to let some one inform me about the new leader");
                                Thread.sleep((long)(3000 + (1000 * Math.random())));
                            } catch (InterruptedException e) {
                            }
                        }
                    }
                } catch (DeadNodeException e) {
                    System.out.println(e.getMessage());
                }
            }
        }
        if (leaderName == null) {
            System.out.println("electing myself as the new leader");
            newLeader(address.getId());
            isElectionInProgress = false;
        }
    }
}).start#$@$#METHOD

edu.concordia.dpis.messenger.UDPServer#$@$#start()#$@$#new Thread(new Runnable(){

    () {
        super();
    }

    public void run() {
        try {
            aSocket = new DatagramSocket(port);
            System.out.println("UDPServer is up and running on port" + port);
            while (true) {
                try {
                    byte[] buffer = new byte[1000];
                    final DatagramPacket request = new DatagramPacket(buffer, buffer.length);
                    aSocket.receive(request);
                    new Thread(new Runnable(){

                        () {
                            super();
                        }

                        @Override()
                        public void run() {
                            try {
                                Message msg = MessageTransformer.deserializeMessage(request.getData());
                                String output = getReplyMessage(msg);
                                if (msg.isReplyToThisMessage()) {
                                    byte[] payload = output.getBytes("US-ASCII");
                                    DatagramPacket reply = new DatagramPacket(payload, payload.length, request.getAddress(), request.getPort());
                                    aSocket.send(reply);
                                }
                            } catch (Exception ex) {
                                ex.printStackTrace();
                            }
                        }
                    }).start();
                } catch (Exception ex) {
                    ex.printStackTrace();
                }
            }
        } catch (SocketException e) {
            System.out.println("Socket: " + e.getMessage());
        } finally {
            if (aSocket != null) {
                aSocket.close();
            }
        }
    }
}).start#$@$#METHOD

